import React from 'react'

type Props = {
  title: string
  color: string
  size: number
}

const Component: React.FC<Props> = props => {
  const logger = str => {
    console.log(str)
  }
  return (
    <div
      className="title"
      style={{ color: props.color, fontSize: props.size * 2 }}
    >
      {props.title}
    </div>
  )
}

export default Component
